class Data_post_Processor(object):
    def __init__(self, indices, Predictions, indices_def, Prediction_Def, fp, fn, datatest, dataval):
        self.indices = indices
        self.Predictions = Predictions
        self.indices_def = indices_def
        self.Prediction_Def = Prediction_Def
        self.fp = fp
        self.fn = fn
        self.datatest = datatest
        self.dataval = dataval

    def process_samples(self, Predictions, Prediction_Def, Indices, Indices_Def, dataval):
        file_names_val = [item["file_name"] for item in dataval]
        print(
            "Misclassified Samples _______________________________________________________________________________"
        )
        Indices = np.array(Indices)
        selected_values_val = [
            file_names_val[idx] for idx in range(len(Indices)) if Indices[idx] == 1
        ]
        print("selected_miscalssified_values:", selected_values_val)
        print("length_selected_miscalssified_values_val:", len(selected_values_val))
        selected_pred_val = [
            Predictions[idx] for idx in range(len(Indices)) if Indices[idx] == 1
        ]
        label_mapping = {0: "label", 1: "~label"}
        pred_val = [label_mapping.get(tensor.item(), tensor) for tensor in selected_pred_val]


        print(
            "Defective samples Correctly classified_______________________________________________________________________________"
        )
        Indices_Def = np.array(Indices_Def)
        selected_values_def_val = [
            file_names_val[idx] for idx in range(len(Indices_Def)) if Indices_Def[idx] == 1
        ]
        print("selected_def_correctly_classified:", selected_values_def_val)
        print("length_selected_val_def_correctly_classified:", len(selected_values_def_val))
        selected_pred_def_val = [
            Prediction_Def[idx] for idx in range(len(Indices_Def)) if Indices_Def[idx] == 1
        ]
        label_mapping = {0: "label", 1: "~label"}
        pred_def_val = [
            label_mapping.get(torch.tensor.item(), torch.tensor) for torch.tensor in selected_pred_def_val
        ]
        return pred_val, selected_values_val, pred_def_val, selected_values_def_val

    def plot__samples(self, ROOT_DIR, selected_values_def_val, selected_values_val, pred_val, pred_def_val, Misclassification_save_dir):
        
        # validation_mis
        validation_mis = CONFI['logger_version'] + "__validation_mis"
        misclassification(
            base_dir=ROOT_DIR,
            samples=selected_values_val,
            target=pred_val,
            save_dir=Misclassification_save_dir,
            name=validation_mis,
        )

        # for_val_def_correctly_classified
        validation_defective_correctly_classified = (
            CONFI['logger_version'] + "__val_def_correctly_classified"
        )
        misclassification(
            base_dir=ROOT_DIR,
            samples=selected_values_def_val,
            target=pred_def_val,
            save_dir=Misclassification_save_dir,
            name=validation_defective_correctly_classified,     
        )    

