class misclassification(object):
    def __init__(
        self, base_dir=None, samples=None, target=None, save_dir=None, name=None
    ) -> None:  #
        self.base_dir = base_dir
        self.samples = samples
        self.target = target
        self.save_dir = save_dir
        self.name = name
        self.images = []
        self.item__(base_dir, samples)  # samples

    def item__(self, base_dir, samples) -> dict:  #
        for file_name in samples:
            full_path = os.path.join(base_dir, file_name)
            output = self._load_img(full_path)
            self.images.append(output)
        self.plot_images(self.images)

    def _load_img(self, path) -> Image:
        img = Image.open(path)
        # img = img.convert(mode="L")
        img = img.convert(mode="RGB")
        return img

    def plot_images(self, images, num_cols=3, images_per_figure=6):
        num_images = len(images)
        if num_images == 0:
            print("No images loaded.")
            return

        num_figures = int(np.ceil(num_images / images_per_figure))

        for figure_idx in range(num_figures):
            start_idx = figure_idx * images_per_figure
            end_idx = min((figure_idx + 1) * images_per_figure, (num_images + 1))

            num_rows = int(np.ceil((end_idx - start_idx) / num_cols))

            fig, axes = plt.subplots(num_rows, num_cols, figsize=(15, 5))

            # for idx, (img_and_filename, ax) in enumerate(zip(zip(images[start_idx:end_idx], self.samples[start_idx:end_idx]), axes.flatten())):
            for idx, (img_and_filename, target, ax) in enumerate(
                zip(
                    zip(images[start_idx:end_idx], self.samples[start_idx:end_idx]),
                    self.target[start_idx:end_idx],
                    axes.flatten(),
                )
            ):
                img, filename = img_and_filename
                ax.imshow(img)
                ax.axis("off")
                ax.set_title(f"{filename}\nModel_Prediciton: {target}")
                # ax.set_title(f"Image {start_idx + idx + 1}")

            plt.tight_layout()
            if self.save_dir:
                full_save_path = os.path.join(
                    self.save_dir, f"{self.name}_figure{figure_idx + 1}.jpg"
                )
                plt.savefig(full_save_path)

            plt.close()  # Close the figure to free up resources


